var hotspots = new List<Vector3>()
{
	new Vector3(907.4639, 4713.876, 43.51472),
	new Vector3(956.3354, 4699.007, 43.90011),
	new Vector3(919.2921, 4649.644, 38.64106),
	new Vector3(1006.53, 4739.956, 39.0179),
	new Vector3(900.4448, 4754.698, 41.06585),
	new Vector3(933.193, 4766.787, 66.32096),
	new Vector3(957.9017, 4763.552, 66.29777),
	new Vector3(894.1814, 4730.729, 67.04298),
	new Vector3(893.9567, 4693.953, 66.92442),
};
var cage =ObjectManager.GetNearestWoWGameObject(ObjectManager.GetWoWGameObjectByEntry(246568));
if (cage != null && cage.IsValid)
{
	foreach (var p in hotspots)
	{
		if (cage.Position.DistanceTo(p) < 21)
		{
			Logging.WriteDebug("[A Fate Worse Than Dying] found " + cage.Name + " at " + cage.Position.ToStringNewVector());
			if (GoToTask.ToPosition(p))
			{
				MountTask.DismountMount();
				Thread.Sleep(Usefuls.Latency * 2);
				if (cage != null && cage.IsValid)
				{
					Logging.WriteDebug("[A Fate Worse Than Dying] interact " + cage.Name + " at " + cage.Position.ToStringNewVector());
					Interact.InteractGameObject(cage.GetBaseAddress, true, false);
					Usefuls.WaitIsCasting();
					if (!wManager.wManagerSetting.IsBlackListed(cage.Guid))
						wManager.wManagerSetting.AddBlackList(cage.Guid, 1 * 60 * 1000, true);
					return true;
				}
				return true;
			}
		}
	}
	if (!wManager.wManagerSetting.IsBlackListed(cage.Guid))
	{
		Logging.WriteDebug("[A Fate Worse Than Dying] cage not in valid point. blacklist= " + cage.Position.ToStringNewVector());
		wManager.wManagerSetting.AddBlackList(cage.Guid, 1 * 60 * 1000, true);
	}
	return true;
}
var p0 = hotspots[Others.Random(0, hotspots.Count - 1)];
Logging.WriteDebug("[A Fate Worse Than Dying] goto random " + p0.ToStringNewVector());
GoToTask.ToPosition(p0);
return true;

public class LeylineFeedHallsoftheEclipse : SuramarQuests.LeylineQuest
{
	public LeylineFeedHallsoftheEclipse()
	{
		Name = "Leyline Feed: Halls of the Eclipse";
		QuestId.Clear();
		QuestId.Add(43594);
		Step.AddRange(new[] { 1, 250 });
	}
}

var portalPosition = new Vector3(302.2647, 4935.062, -83.89333);
var shipCenter = new Vector3(664.96, 4822.75, -90.06, "None");
var shipNearPortal = new Vector3(681.2319, 4849.485, -88.35743, "None");
var bossPosition = new Vector3(664.3038, 4820.936, -70.73068, "None");
var myPos = ObjectManager.Me.Position;
if (!Questing.ObjectiveComplete(this, 1))
{
	if (myPos.DistanceTo(shipCenter) > 100)
	{
		Logging.WriteDebug("[Azoran Must Die] use portal to ship");
		Questing.Gather(portalPosition, 247027);
		return true;
	}
	if (myPos.DistanceTo(shipCenter) < 10)
	{
		Logging.WriteDebug("[Azoran Must Die] away from ship center");
		Questing.ClickMove(shipNearPortal);
		Questing.Wait(3);
		return true;
	}
	if (myPos.DistanceZ(bossPosition) > 10 || myPos.DistanceTo2D(bossPosition) > 30)
	{
		Logging.WriteDebug("[Azoran Must Die] to boss");
		GoToTask.ToPosition(bossPosition);
		return true;
	}
	Logging.WriteDebug("[Azoran Must Die] kill");
	Questing.Attack(100019);
	return true;
}
Logging.WriteDebug("[Azoran Must Die] use portal from ship");
Questing.Gather(shipCenter, 247029);
return true;

